CREATE FUNCTION public.datos_medico(p_id integer) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
    result RECORD;
BEGIN
    SELECT m.Nombre, m.Apellido, e.Nombre AS Especialidad
    INTO result
    FROM Medicos m
    JOIN Especialidades e ON m.id_especialidad = e.id_especialidad
    WHERE m.id_medicos = p_id;

    RETURN result;
END;
$$;


