--

CREATE FUNCTION public.obtener_edad(p_id integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    edad INT;
BEGIN
    SELECT DATE_PART('year', AGE(Fecha_Nacimiento)) INTO edad
    FROM Pacientes
    WHERE id_pacientes = p_id;
    RETURN edad;
END;
$$;


