--
-- Name: vista_citas_dia_por_medico; Type: VIEW; Schema: public; Owner: grupo2
--

CREATE VIEW public.vista_citas_dia_por_medico AS
 SELECT m.nombre AS nombre_medico,
    m.apellido AS apellido_medico,
    c.fecha_cita,
    c.hora_cita,
    p.nombre AS nombre_paciente,
    p.apellido AS apellido_paciente
   FROM ((public.citasmedicas c
     JOIN public.medicos m ON ((c.id_medicos = m.id_medicos)))
     JOIN public.pacientes p ON ((c.id_pacientes = p.id_pacientes)))
  WHERE (c.fecha_cita = '2025-05-03'::date);


ALTER VIEW public.vista_citas_dia_por_medico OWNER TO grupo2;

--
-- Name: vista_historial_recetas_por_paciente; Type: VIEW; Schema: public; Owner: grupo2
--

CREATE VIEW public.vista_historial_recetas_por_paciente AS
 SELECT p.nombre AS nombre_paciente,
    p.apellido AS apellido_paciente,
    r.medicamento,
    r.dosis,
    r.frecuencia,
    r.duracion,
    r.fecha_emision
   FROM (((public.recetasmedica r
     JOIN public.tratamientos t ON ((r.id_tratamiento = t.id_tratamiento)))
     JOIN public.diagnosticos d ON ((t.id_diagnostico = d.id_diagnostico)))
     JOIN public.pacientes p ON ((d.id_pacientes = p.id_pacientes)));


ALTER VIEW public.vista_historial_recetas_por_paciente OWNER TO grupo2;

--
-- Name: vista_pacientes_citas_y_facturas_pagadas; Type: VIEW; Schema: public; Owner: grupo2
--

CREATE VIEW public.vista_pacientes_citas_y_facturas_pagadas AS
 SELECT p.nombre AS nombre_paciente,
    p.apellido AS apellido_paciente,
    c.fecha_cita,
    c.hora_cita,
    f.monto_total,
    f.fecha_emision AS fecha_factura
   FROM ((public.citasmedicas c
     JOIN public.pacientes p ON ((c.id_pacientes = p.id_pacientes)))
     JOIN public.facturacion f ON ((c.id_citas = f.id_citas)))
  WHERE (f.estado = 1);


ALTER VIEW public.vista_pacientes_citas_y_facturas_pagadas OWNER TO grupo2;

--
-- Name: vista_pacientes_con_diagnostico; Type: VIEW; Schema: public; Owner: grupo2
--

CREATE VIEW public.vista_pacientes_con_diagnostico AS
 SELECT p.nombre AS nombre_paciente,
    p.apellido AS apellido_paciente,
    d.descripcion AS diagnostico,
    d.fecha_diagnostico
   FROM (public.diagnosticos d
     JOIN public.pacientes p ON ((d.id_pacientes = p.id_pacientes)))
  WHERE ((d.descripcion)::text ~~ '%Diabetes controlada%'::text);


ALTER VIEW public.vista_pacientes_con_diagnostico OWNER TO grupo2;

--
-- Name: vista_pacientes_en_urgencias; Type: VIEW; Schema: public; Owner: grupo2
--

CREATE VIEW public.vista_pacientes_en_urgencias AS
 SELECT p.nombre AS nombre_paciente,
    p.apellido AS apellido_paciente,
    u.sintomas,
    u.fecha_ingreso,
    m.nombre AS nombre_medico,
    m.apellido AS apellido_medico
   FROM ((public.urgencias u
     JOIN public.pacientes p ON ((u.id_pacientes = p.id_pacientes)))
     JOIN public.medicos m ON ((u.id_medicos = m.id_medicos)))
  WHERE (u.estado = 1);


ALTER VIEW public.vista_pacientes_en_urgencias OWNER TO grupo2;

